import React from 'react';
import LinkLogin from "./../LinkLogin";
import { Link } from "react-router-dom";



export default function HeaderMain() {
    return (
        <div>
            <header>
                <img src="https://res.cloudinary.com/dpdlhag1u/image/upload/v1597752904/logo-appiwedia-white_dg38qn.png" alt="logosite" className="logo-header" />
                    <ul className="nav-links">

                        <li><Link to="/home">Home</Link></li>
                        <li><Link to="/about">About</Link></li>
                        <li><Link to="/contact">Contact</Link></li>
                        <li><Link to="/annonces">Annonces</Link></li>
                        <li><Link to="/associations">Associations</Link></li>
                        <li><LinkLogin /></li>
                    </ul>
            </header>
        </div>
    )
}
